import React, {Component} from "react";
import './user-form.css';

export default class UserFormComponent extends Component{
    render() {
        return(
            <div id="login-component" className="container-fluid">
                <div className="card">
                    <div className="card-body">
                        <img src="./logo.png"/>
                    </div>
                </div>
            </div>
        );
    }
}
